import React from 'react';
import axios from 'axios'
import { useState } from 'react';
import { useEffect } from 'react';


export default function Display({ }) {

    const [data, setData] = useState([]);


console.log(data);


useEffect(() => {

  fetchData();

}, []);

const fetchData = async () => {

  console.log(fetchData);

  try {
    const response = await axios.get('http://localhost:9000/aliens');


    console.log(response, 'show');

    setData(response.data);

  } catch (error) {

    console.log(error);

  }
};

return (
  <div className="table-container">
    <table className="styled-table">
      <thead>
        <tr>
          <th>ID</th>
          <th>Order Number</th>
          <th>Stamp</th>
          <th>Status</th>
        </tr>
      </thead>
      <tbody>
        {data.map((item) => (
          <tr key={item.id}>
            <td>{item.id}</td>
            <td>{item.query[0].query_string.order_number}</td>
            <td>{item.query[0].query_string.stamp}</td>
            <td>{item.query[0].query_string.status}</td>
          </tr>
        ))}
      </tbody>
    </table>
  </div>
);
